import React, { useState } from 'react';
import './SearchBar.css';
import { useNavigate } from 'react-router-dom';

const SearchBar = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const navigate = useNavigate();

  const handleSearchSubmit = (e) => {
    e.preventDefault();
    if (searchQuery.trim()) {
      navigate(`/search?q=${encodeURIComponent(searchQuery)}`);
    }
  };

  return (
      <div className="searchBox">
      <svg 
        className="search-wave" 
        viewBox="0 0 1200 120" 
        preserveAspectRatio="none"
      >
        <path 
          d="M0,0V25c47.79,12,103.59,18,158,15,70.36-3,136.33-18,206.8-20C438.64,17,512.34,28,583,38c69.27,10,138.3,13,209.4,7,36.15-3,69.85-10,104.45-16C989.49,14,1113-8,1200,28V0Z"
          fill="#000"
          opacity="0.2"
          transform="translate(0, 3) scale(1.02, 1)"
          filter="url(#blurFilter)"
        />
        <path 
          d="M0,0V25c47.79,12,103.59,18,158,15,70.36-3,136.33-18,206.8-20C438.64,17,512.34,28,583,38c69.27,10,138.3,13,209.4,7,36.15-3,69.85-10,104.45-16C989.49,14,1113-8,1200,28V0Z" 
          opacity="1" 
          fill="#003566"
        />
      </svg>
        <h1>SlugHub</h1>
        <form className="search-form" onSubmit={handleSearchSubmit}>
          <input
            type="text"
            className="search-input"
            placeholder="Search events..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
          <button type="submit" className="search-button">
            <img className="search-icon" src="/images/search-icon-png-21.png" alt="searchIcon" />
          </button>
        </form>
      </div>
  );
};

export default SearchBar;
